import{_ as e,o as i,c as a,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 2.2-609 Copies of state publications furnished to Librarian of Virginia.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-609.md","filePath":"vacode/2.2-609.md"}'),t={name:"vacode/2.2-609.md"},o=r('<h1 id="§-2-2-609-copies-of-state-publications-furnished-to-librarian-of-virginia" tabindex="-1">§ 2.2-609 Copies of state publications furnished to Librarian of Virginia. <a class="header-anchor" href="#§-2-2-609-copies-of-state-publications-furnished-to-librarian-of-virginia" aria-label="Permalink to &quot;§ 2.2-609 Copies of state publications furnished to Librarian of Virginia.&quot;">​</a></h1><p>A. Pursuant to the State Publications Depository Program (§ <a href="http://law.lis.virginia.gov/vacode/42.1-92/" target="_blank" rel="noreferrer">42.1-92</a> et seq.), every agency, institution, collegial body, or other state governmental entity of any branch of government shall furnish a maximum of 20 copies of each of its publications, as defined in § <a href="http://law.lis.virginia.gov/vacode/42.1-93/" target="_blank" rel="noreferrer">42.1-93</a>, or, if authorized by the Library, other publication information as may be designated by the Library to facilitate the acquisition and distribution of publications, regardless of physical form or characteristics.</p><p>B. Every agency, institution, collegial body, or other state governmental entity of any branch of government shall provide information requested by the Library to assist in the publication of an annual catalog of state agency publications as required by § <a href="http://law.lis.virginia.gov/vacode/42.1-95/" target="_blank" rel="noreferrer">42.1-95</a> of the State Publications Depository Program.</p><p>C. For purposes of this section, &quot;Library&quot; means The Library of Virginia.</p><p>1977, c. 672, §§ 2.1-467.2, 2.1-467.4; 1979, c. 403; 1981, c. 234; 1992, c. 181; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0064" target="_blank" rel="noreferrer">64</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0427" target="_blank" rel="noreferrer">427</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0028" target="_blank" rel="noreferrer">28</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0152" target="_blank" rel="noreferrer">152</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0059" target="_blank" rel="noreferrer">59</a>.</p>',5),n=[o];function s(l,c,f,g,p,h){return i(),a("div",null,n)}const d=e(t,[["render",s]]);export{u as __pageData,d as default};
